import { Component, ElementRef, OnInit } from '@angular/core';
import { ActivatedRoute } from '@angular/router';
import { HttpErrorResponse, HttpResponse } from '@angular/common/http';
import { Observable } from 'rxjs';
import { filter, map } from 'rxjs/operators';
import { JhiAlertService, JhiDataUtils } from 'ng-jhipster';
import { ConectorBarril, IBarril } from 'app/shared/model/barril.model';
import { BarrilService } from './barril.service';
import { IEmpresa } from 'app/shared/model/empresa.model';
import { EmpresaService } from 'app/entities/empresa';
import { ILote } from 'app/shared/model/lote.model';
import { LoteService } from 'app/entities/lote';
import { ICliente } from 'app/shared/model/cliente.model';
import { ClienteService } from 'app/entities/cliente';
import { LocalStorageService } from 'ngx-webstorage';

@Component({
  selector: 'jhi-barril-update',
  templateUrl: './barril-update.component.html'
})
export class BarrilUpdateComponent implements OnInit {
  barril: IBarril;
  isSaving: boolean;
  empresa: IEmpresa;
  empresas: IEmpresa[];

  lotes: ILote[];

  clientes: ICliente[];

  constructor(
    protected dataUtils: JhiDataUtils,
    protected jhiAlertService: JhiAlertService,
    protected barrilService: BarrilService,
    protected empresaService: EmpresaService,
    protected loteService: LoteService,
    protected clienteService: ClienteService,
    protected elementRef: ElementRef,
    protected activatedRoute: ActivatedRoute,
    protected $localStorage: LocalStorageService
  ) {}

  ngOnInit() {
    this.isSaving = false;
    this.activatedRoute.data.subscribe(({ barril }) => {
      this.barril = barril;
    });
    this.empresa = this.$localStorage.retrieve('empresa');
    this.empresaService
      .query()
      .pipe(
        filter((mayBeOk: HttpResponse<IEmpresa[]>) => mayBeOk.ok),
        map((response: HttpResponse<IEmpresa[]>) => response.body)
      )
      .subscribe((res: IEmpresa[]) => (this.empresas = res), (res: HttpErrorResponse) => this.onError(res.message));
    this.loteService
      .query()
      .pipe(
        filter((mayBeOk: HttpResponse<ILote[]>) => mayBeOk.ok),
        map((response: HttpResponse<ILote[]>) => response.body)
      )
      .subscribe((res: ILote[]) => (this.lotes = res), (res: HttpErrorResponse) => this.onError(res.message));
    this.clienteService
      .query()
      .pipe(
        filter((mayBeOk: HttpResponse<ICliente[]>) => mayBeOk.ok),
        map((response: HttpResponse<ICliente[]>) => response.body)
      )
      .subscribe((res: ICliente[]) => (this.clientes = res), (res: HttpErrorResponse) => this.onError(res.message));
  }

  byteSize(field) {
    return this.dataUtils.byteSize(field);
  }

  openFile(contentType, field) {
    return this.dataUtils.openFile(contentType, field);
  }

  setFileData(event, entity, field, isImage) {
    this.dataUtils.setFileData(event, entity, field, isImage);
  }

  clearInputImage(field: string, fieldContentType: string, idInput: string) {
    this.dataUtils.clearInputImage(this.barril, this.elementRef, field, fieldContentType, idInput);
  }

  previousState() {
    window.history.back();
  }

  save() {
    this.isSaving = true;
    this.loadImagen();
    this.barril.empresaId = this.empresa.id;
    if (this.barril.id !== undefined) {
      this.subscribeToSaveResponse(this.barrilService.update(this.barril));
    } else {
      this.subscribeToSaveResponse(this.barrilService.create(this.barril));
    }
  }

  protected subscribeToSaveResponse(result: Observable<HttpResponse<IBarril>>) {
    result.subscribe((res: HttpResponse<IBarril>) => this.onSaveSuccess(), (res: HttpErrorResponse) => this.onSaveError());
  }

  protected onSaveSuccess() {
    this.isSaving = false;
    this.previousState();
  }

  protected onSaveError() {
    this.isSaving = false;
  }

  protected onError(errorMessage: string) {
    this.jhiAlertService.error(errorMessage, null, null);
  }

  trackEmpresaById(index: number, item: IEmpresa) {
    return item.id;
  }

  trackLoteById(index: number, item: ILote) {
    return item.id;
  }

  trackClienteById(index: number, item: ICliente) {
    return item.id;
  }

  loadImagen() {
    if (this.barril.conector === ConectorBarril.BALL_LOCK || this.barril.conector === ConectorBarril.PIN_LOCK) {
      this.barril.imagenContentType = 'image/jpeg';
      this.barril.imagen =
        '';
    } else {
      this.barril.imagenContentType = 'image/png';
      this.barril.imagen =
        '';
    }
  }
}
